pragma solidity ^0.8.0;

import "./Ownable.sol";
import "./Strings.sol";
import "./Address.sol";
import "./Pausable.sol";
import "./ReentrancyGuard.sol";
import "./IMintables.sol";
import "./AggregatorV3Interface.sol";

contract NodiSeller is  Ownable , Pausable, ReentrancyGuard{

     using Address for address payable;

    using Strings for uint256;    

    address public fundsReceiver;

    IMintable public collection;

    AggregatorV3Interface private usdByEthFeed;

    AggregatorV3Interface private usdByEurFeed;

    uint256 tokenPriceEuroCents = 39900;

    uint256[] public availableTokenIds;

    uint256 private maxTokenPerAddress = 5;

    event preMintToken(uint256[] _toTokenId);

    address private minter;

    constructor(address _collectionAddress, address _fundsReceiver,address _usdByEthFeed,address _UsdByEuroFeedAddress)
    {
        collection = IMintable(_collectionAddress);
        fundsReceiver = _fundsReceiver;
        usdByEthFeed = AggregatorV3Interface(_usdByEthFeed);
        usdByEurFeed = AggregatorV3Interface(_UsdByEuroFeedAddress);   
    }

    function mint(address to, uint256 quantity) external payable nonReentrant {
        require(!paused(), "is on pause !");
        require(_msgSender() == tx.origin, "Contracts cannot mint");    
        require(to!=address(0),"Bad address");
        require(quantity<=availableTokenIds.length,"token sold out");
        require(collection.balanceOf(to) + quantity <= maxTokenPerAddress, "Max token par wallet limit");   
        uint256 weiPrice = getWeiPrice(quantity);
        uint256 minPrice = (weiPrice * 995) / 1000;
        uint256 maxPrice = (weiPrice * 1005) / 1000;
        require(msg.value >=  minPrice ,"bad price");
        require(msg.value <=  maxPrice ,"bad price");
        uint256[] memory idsToMint = new uint256[](quantity);
         for(uint256 i = 0 ; i < quantity; i++ ){
            uint256 index = getRandomToken();
            uint256 tokenId =  availableTokenIds[index];
            // if more than 2 elements and not the last of the array, wa save the last element at the removed index.
            if(availableTokenIds.length > 1 && index != (availableTokenIds.length -1)){
                availableTokenIds[index] = availableTokenIds[availableTokenIds.length-1];
            }                        
            availableTokenIds.pop();
            idsToMint[i] = tokenId;
        }        
        collection.mints(to,idsToMint);
    }


    function mintPresale(address[] memory to) external nonReentrant {
        require(!paused(), "is on pause !");
        require(msg.sender == minter || msg.sender == owner(),"Not allowed");
        require(to.length<=availableTokenIds.length,"token sold out");
        for(uint256 i = 0 ; i < to.length; i++ ){
            require(to[i]!=address(0),"Bad address");
            require(collection.balanceOf(to[i]) == 0, "Max token par wallet limit");
            uint256 index = getRandomToken();
            uint256 tokenId =  availableTokenIds[index];
            // if more than 2 elements and not the last of the array, wa save the last element at the removed index.
            if(availableTokenIds.length > 1 && index != (availableTokenIds.length -1)){
                availableTokenIds[index] = availableTokenIds[availableTokenIds.length-1];
            }
            availableTokenIds.pop();
            collection.mint(to[i],tokenId);
        }
    }

    function premint(uint256 quantity) external  {
        require(msg.sender == minter || msg.sender == owner(),"Not allowed");
        require(!paused(), "is on pause !");
        require(quantity > 0,"Bad quantity");
        require(quantity<=availableTokenIds.length,"token sold out");
        uint256[] memory idsToMint = new uint256[](quantity);
         for(uint256 i = 0 ; i < quantity; i++ ){
            uint256 index = getRandomToken();
            uint256 tokenId =  availableTokenIds[index];
            // if more than 2 elements and not the last of the array, wa save the last element at the removed index.
            if(availableTokenIds.length > 1 && index != availableTokenIds.length){
                availableTokenIds[index] = availableTokenIds[availableTokenIds.length-1];
            }
            availableTokenIds.pop();
            idsToMint[i] = tokenId;                        
        }
